import React from 'react'

const Exercicio2 =  (props) => {



  return (
    <div>
      {props.posts.map((item) => (
        <div key={item}>
          <div>{item.title}</div>
          <div>{item.content}</div>
        </div>
      ))
      }
    </div>
  )
}

export default Exercicio2
